import React from 'react';
import validate, { useForm } from '../../../hooks';

const EducationForm = () => {
  const { errors, values, handleChange, handleSubmit } = useForm(
    login,
    validate
  );
  function login(values) {
    console.log(values);
  }
  return (
    <form onSubmit={handleSubmit}>
      <div className="education">
        <h3>Education</h3>
        <div className="input-field">
          <label htmlFor="school">School</label>
          <input
            type="text"
            name="school"
            id="school"
            value={values.school || ''}
            onChange={handleChange}
          />
        </div>
        <div className="input-field">
          <label htmlFor="degree">Degree</label>
          <input
            type="text"
            name="degree"
            id="degree"
            value={values.degree || ''}
            onChange={handleChange}
          />
        </div>
        <div className="input-field">
          <label htmlFor="fieldOfStudy">Field Of Study</label>
          <input
            type="text"
            name="fieldOfStudy"
            id="fieldOfStudy"
            value={values.fieldOfStudy || ''}
            onChange={handleChange}
          />
        </div>
        <div className="input-field">
          <label htmlFor="school-from">From</label>
          <input
            type="date"
            name="schoolFrom"
            id="schoolFrom"
            onChange={handleChange}
          />
        </div>
        <div className="input-field">
          <label htmlFor="school-to">To</label>
          <input
            type="date"
            name="schoolTo"
            id="schoolTo"
            onChange={handleChange}
          />
        </div>
      </div>
      <div className="submit-buttons">
        <button>Save</button>
      </div>
    </form>
  );
};

export default EducationForm;
